import React, { Fragment } from "react";
import "./style.scss"

function navbar() {
    return(
        <Fragment>
            <div className="imagen">
            <IconButton
            edge="start"
            className={classes.menuButton}
            color="inherit"
            aria-label="open drawer"
          >
            <MenuIcon />
          </IconButton>
            </div>
            
            
        </Fragment>
   )
    
}

export default navbar
